import React, { useEffect, useState } from 'react';
import { getBookings } from './api';

interface Booking {
  id: number;
  service_type: string;
  date: string;
  time: string;
}

function App() {
  const [bookings, setBookings] = useState<Booking[]>([]);

  useEffect(() => {
    const fetchData = async () => {
      const data = await getBookings();
      setBookings(data);
    };
    fetchData();
  }, []);

  return (
    <div>
      <h1>Mis Reservas</h1>
      <ul>
        {bookings.map(booking => (
          <li key={booking.id}>
            {booking.service_type} - {booking.date} a las {booking.time}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
